choices.text:
COSBase base = getObject(i);
if (base instanceof COSNumber)
{
  COSNumber cosNumber = (COSNumber)base;
  retval[i] = cosNumber.floatValue();
}

Object obj = getObject(i);
if (obj instanceof COSNumber) {
    retval[i] = ((COSNumber)obj).floatValue();
} else if (obj instanceof COSString) {
    String str = ((COSString)obj).getString();
    retval[i] = Float.parseFloat(str);
}

